import React, { useEffect, useState } from 'react';
import axios from 'axios';

const OwnerScreen = () => {
  const [codDetails, setCodDetails] = useState([]);

  useEffect(() => {
    axios.get('http://127.0.0.1:8000/cod-details/')
      .then(response => {
        console.log('Response data:', response.data); // Log the response data
        setCodDetails(response.data);
      })
      .catch(error => {
        console.error("There was an error fetching the COD details!", error);
      });
  }, []);

  return (
    <div>
      <h1>Owner Screen - Cash on Delivery Details</h1>
      {codDetails.length > 0 ? (
        <ul>
          {codDetails.map(detail => (
            <li key={detail.id}>
              <p>Name: {detail.name}</p>
              <p>Phone: {detail.phone}</p>
              <p>Email: {detail.email}</p>
              <p>Address: {detail.address}</p>
            </li>
          ))}
        </ul>
      ) : (
        <p>No details available yet.</p> // Display this if no data is returned
      )}
    </div>
  );
};

export default OwnerScreen;
